  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Parker
  River NWR, Pond Island NWR, and Tacher's Island NWR outlines Refuge accomplishments
  during the 1989 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. Refuge administration is outlined;
  information about personnel, youth programs, volunteer programs, funding, and safety
  is given. Habitat management is also covered; subjects include wetlands, grasslands,
  haying, fire management, pest control, and wilderness areas. The wildlife section
  of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, game mammals, animal control, and
  marking and bird banding. The public uses of the Refuge described in this report
  include outdoor classrooms, interpretive programs, hunting, fishing, wildlife observation,
  outdoor recreation, and law enforcement. The equipment and facilities section of
  the report provides information about new construction, rehabilitation, equipment
  replacement, and computer systems. Items of interest are provided at the end. Refuge
  brochures and field guides are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
